    <div className="app-container">
      <header className="app-header">
        <h1>Welcome to the E-commerce Website</h1>
      </header>

      <main>
        <ProductList />
      </main>

      <footer className="app-footer">
        <p>© 2025 E-commerce Website</p>
      </footer>
    </div>
  );
};

export default App;
